// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract LuxuryJewelry {

    struct JewelryItem {
        uint256 id;
        string description;
        address currentOwner;
        bool isIssued;
        string miningInfo;       // 
        string cuttingInfo;      // 
        string engravingInfo;    // 
        string makingInfo;       // 
        string ownershipHistory; // 
    }

    mapping(uint256 => JewelryItem) public jewelryItems;
    address public admin;
    mapping(address => bool) private authorizedUsers;

    event JewelryIssued(uint256 indexed id, address indexed owner);
    event OwnershipTransferred(uint256 indexed id, address indexed from, address indexed to);
    event JewelryInfoUpdated(uint256 indexed id, string infoType, string info);

    constructor() {
        admin = msg.sender;
    }

    modifier onlyAdmin() {
        require(msg.sender == admin, "Only admin can perform this action");
        _;
    }

    modifier onlyAuthorized() {
        require(authorizedUsers[msg.sender], "Not authorized");
        _;
    }

    function issueJewelryItem(uint256 _id, string memory _description, address _owner) public onlyAdmin {
        require(!jewelryItems[_id].isIssued, "Item already issued");
        jewelryItems[_id] = JewelryItem({
            id: _id,
            description: _description,
            currentOwner: _owner,
            isIssued: true,
            miningInfo: '',
            cuttingInfo: '',
            engravingInfo: '',
            makingInfo: '',
            ownershipHistory: ''
        });
        emit JewelryIssued(_id, _owner);
    }

    function transferOwnership(uint256 _id, address _newOwner) public {
        require(jewelryItems[_id].isIssued, "Item not issued");
        require(msg.sender == jewelryItems[_id].currentOwner, "Only current owner can transfer");
        jewelryItems[_id].currentOwner = _newOwner;
        jewelryItems[_id].ownershipHistory = string(abi.encodePacked(jewelryItems[_id].ownershipHistory, "; Transferred to: ", toString(_newOwner)));
        emit OwnershipTransferred(_id, msg.sender, _newOwner);
    }

    function updateJewelryInfo(uint256 _id, string memory _miningInfo, string memory _cuttingInfo, string memory _engravingInfo, string memory _makingInfo) public onlyAuthorized {
        require(jewelryItems[_id].isIssued, "Item not issued");
        jewelryItems[_id].miningInfo = _miningInfo;
        jewelryItems[_id].cuttingInfo = _cuttingInfo;
        jewelryItems[_id].engravingInfo = _engravingInfo;
        jewelryItems[_id].makingInfo = _makingInfo;
        emit JewelryInfoUpdated(_id, "Full Info", "Updated");
    }

    function authorizeUser(address _user) public onlyAdmin {
        authorizedUsers[_user] = true;
    }

    function revokeUser(address _user) public onlyAdmin {
        authorizedUsers[_user] = false;
    }

    function toString(address _addr) private pure returns (string memory) {
        bytes32 value = bytes32(uint256(uint160(_addr)));
        bytes memory alphabet = "0123456789abcdef";
        bytes memory str = new bytes(42);
        str[0] = '0';
        str[1] = 'x';
        for (uint256 i = 0; i < 20; i++) {
            str[2+i*2] = alphabet[uint8(value[i + 12] >> 4)];
            str[3+i*2] = alphabet[uint8(value[i + 12] & 0x0f)];
        }
        return string(str);
    }
}
